$(document).ready(function(){

  /* add close buttons to portalMessage */
  $('.portalMessage').each(function(){
    var $el = $(this);
    var $btn = $('<button type="button" class="close" data-dismiss="alert" aria-label="Close"><span aria-hidden="true">&times;</span></button>');
    $el.prepend($btn);
    $btn.on('click', function(e){
      e.preventDefault();
      $el.fadeOut();
    });
  });


  /* feature tile integration,
     this could be a pattern. will just leave here for now... */
  var $features = $('.feature-tile-container');
  $features.each(function(){
    var $feature = $(this);
    var $details = $('.feature-tile-expanded-container', $feature);

    var $rowContainer = $feature.closest('.row .mosaic-grid-cell');

    $rowContainer.addClass('feature-tile-row');
    $details.insertAfter($rowContainer);

    $('.feature-tile-item', $feature).on('click', function(){
      var enabled = false;
      if($feature.hasClass('active')){
        enabled = true;
      }
      $features.removeClass('active');
      $('.feature-tile-expanded-container').removeClass('active');

      if(!enabled){
        // should be able to close
        $details.addClass('active');
        $feature.addClass('active');
      }
    });
  });


  var cookieKey = '__castle_fv__'
  var firstVisitCookie = $.cookie(cookieKey);

  // check if cookie exists and will display first time visit message
  if (firstVisitCookie !== "acknowledged") {
    $.cookie(cookieKey, 'shown', {
      path: '/',
      expires: 2147483647
    });
    $.ajax({
      type: "GET",
      url: PORTAL_URL + '/disclaimer',
    }).done(function(res) {
       if (res.enabled) {
         // create divs
         $("<div id='disclaimerOverlay'><div id='disclaimerDiv'>" + res.msg + "</div></div>").appendTo('body');
         // create close button
         $("<a id='closeButton' href='javascript:void(0);'>Close</a>").appendTo('#disclaimerDiv');
         // close div functionality
         document.getElementById("closeButton").addEventListener("click", function(e) {
          document.getElementById("disclaimerOverlay").style.display = "none";
          $.cookie(cookieKey, 'acknowledged', {
            path: '/',
            expires: 2147483647
          });
         });
         // display div
         document.getElementById("disclaimerOverlay").style.display = "block";
       }
    });
  }

});


